import PropTypes from 'prop-types';
import Link from 'next/link';
import { Menu } from 'antd';

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>
        <Link href="/">
          <a>supercoder</a>
        </Link>
        <Link href="/profile">
          <a>profile</a>
        </Link>
        <Link href="/signup">
          <a>signup</a>
        </Link>
      </div>
      {children}
    </div>
  );
};

AppLayout.propTypes = { children: PropTypes.node.isRequired };

export default AppLayout;
